Animal Crime Scene (BBC )

Nature Documentary hosted by David Attenborough, published by BBC in 2005 - English narration


Information
------------------------------

BBC Animal Crime Scene
This is a murder mystery series with a twist - all the characters are animals! In this case, Sir David Attenborough investigates the disturbing death of a young Thomson's gazelle on the plains of Africa. In this dangerous world, our victim was surrounded by potential killers - big cats, clever jackals, local hyenas - even vultures and giant snakes are on the suspect list. But who did it? This story is story based on real events in the natural world and draws on the latest forensic science to solve the crime. Will you be able to piece together the clues and follow the trail to guess the identity of the killer in this wildlife who dunit?


1)  Outback Assassin 
The first programme in a murder mystery series with a real twist - all the characters are animals. In this case, David Attenborough investigates the strange death of a kangaroo in the Australian outback. Found at the edge of a bushfire, there's good reason to suspect foul play Australia is full of dangerous creatures - poisonous snakes and spiders, killer crocodiles and crafty dingoes, but who's to blame? This story is based on real events in the natural world and draws on the latest forensic science to solve the crime. Will you be able to piece together the clues and follow the trail to guess the identity of the killer in this wildlife whodunnit?



